INSERT INTO `products` (`id`, `name`, `cara_penggunaan`, `bpom`, `ml`, `weight`, `price`, `description`, `howtouse`, `suitedto`, `skinfeel`, `keyingredients`, `ingredients`, `image`, `created_at`, `updated_at`) VALUES
(1, 'Daily Protection Sunscreen', '<p class=\"15\" style=\"margin-bottom:0.0000pt;margin-left:36.0000pt;text-indent:-18.0000pt;\r\nmso-list:l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family:Calibri;font-size:11.0000pt;\">-</span><!--[endif]--><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\">Tekan pump pada botol, keluarkan isi produk sebanyak 2-3 tekanan. Usap dan ratakan ke seluruh wajah</span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\"><o:p></o:p></span></p><p class=\"15\" style=\"margin-bottom:0.0000pt;margin-left:36.0000pt;text-indent:-18.0000pt;\r\nmso-list:l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family:Calibri;font-size:11.0000pt;\">-</span><!--[endif]--><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\">Pijat lembut pada bagian wajah dan leher dengan ujung jari anda</span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\"><o:p></o:p></span></p><p class=\"15\" style=\"margin-bottom:0.0000pt;margin-left:36.0000pt;text-indent:-18.0000pt;\r\nmso-list:l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family:Calibri;font-size:11.0000pt;\">-</span><!--[endif]--><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\">Gunakan secara teratur pada siang hari setelah membersihkan wajah dan setelah menggunakan serum</span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\"><o:p></o:p></span></p>', 'NA18210102719', '20', '440', '200000', 'Youthderma Daily Protection Sunscreen merupakan tabir surya yang dapat digunakan sehari- hari, bertekstur ringan cocok untuk jenis kulit kering dan berminyak. Mengandung formula yang memberikan perlindungan ekstra terhadap UVA & UVB SPF 50 PA +++', 'Apply on clean face Daily Protection Sunscreen can be layered with your choice of foundation to give a dewy glow.', 'Semua jenis kulit.', 'Protected and hydrated with a non-greasy finish.', '<p class=\"MsoNormal\" style=\"margin-bottom:0.0000pt;\"><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\">Aqua, Titanium Dioxide, cetyl alcohol, Triceteareth-4, phosphate, sodium cocoyl glycinate, Tranexamic acid, ceramide 3, butylene glycol, ammonium acryloyldimethyltaurate/vp, copolymer, Phenyl Trimethicone, caprylyl methicone, Zinc Oxide, Glycerin, Argania Spinosa Kernel Oil, Phenoxyethanol, Dmdm hydantoin, Citric Acid, Glutathione, Disodium EDTA, cananga odorata flower oil, TEA ( Camelia Sinensis ) Oil.</span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\"><o:p></o:p></span></p>', '<p class=\"MsoNormal\" style=\"margin-bottom:0.0000pt;\"><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">- Tranexamic Acid Bahan aktif untuk mencerahkan warna kulit dan memperbaiki tampilan perubahan warna seperti bintik matahari, dan hiper pigmentasi. </span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0.0000pt;\"><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">- Zinc Oxide Memberikan perlindungan matahari berspektrum luas.</span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\"></span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">Mengurangi iritasi dan alergi kulit.</span><span class=\"15\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\"></span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">Juga menjaga kelembapan terkunci pada kulit kering. </span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0.0000pt;\"><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">- Titanium Dioxide </span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">memilki manfaat perlindungan </span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">terhadap radiasi ultraviolet.</span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\"><o:p></o:p></span></p>', '072021270632732_25.jpg', '2021-05-21 03:29:01', '2021-07-26 23:34:32'),
(2, 'Night Radiance Cream', '<p class=\"15\" style=\"margin-bottom:0.0000pt;margin-left:36.0000pt;text-indent:-18.0000pt;\r\nmso-list:l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family:Calibri;font-size:11.0000pt;\">-</span><!--[endif]--><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\">Tekan pump pada botol, keluarkan isi produk sebanyak 2-3 tekanan. Usap dan ratakan ke seluruh wajah</span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\"><o:p></o:p></span></p><p class=\"15\" style=\"margin-bottom:0.0000pt;margin-left:36.0000pt;text-indent:-18.0000pt;\r\nmso-list:l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family:Calibri;font-size:11.0000pt;\">-</span><!--[endif]--><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\">Pijat lembut pada bagian wajah dan leher dengan ujung jari anda</span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\"><o:p></o:p></span></p><p class=\"15\" style=\"margin-bottom:0.0000pt;margin-left:36.0000pt;text-indent:-18.0000pt;\r\nmso-list:l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family:Calibri;font-size:11.0000pt;\">-</span><!--[endif]--><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\">Gunakan secara teratur pada malam hari setelah membersihkan wajah dan setelah menggunakan serum</span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\"><o:p></o:p></span></p>', 'NA18210102721', '20', '150', '250000', 'Youthderma Night Radiance Cream merupakan cream malam perawatan untuk anti aging dan memiliki manfaat untuk mencerahkan kulit wajah, memudarkan flek hitam dan bekas jerawat, mencegah kerutan dan tanda penuaan pada kulit wajah.', 'Apply to a clean face at night', 'Semua Jenis Kulit.', 'Moist, Smooth, Even Skin Tone, Skin Becomes More Supple.', '<p class=\"MsoNormal\" style=\"margin-bottom:0.0000pt;\"><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\">Aqua, Glyceryl Stearate, Cetearyl Alcohol, Lactic Acid, Glycolic </span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\"><o:p></o:p></span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\">acid, cetyl alcohol, Stearic Acid, Isopropyl myristate, Dimethicone, </span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\"><o:p></o:p></span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\">Propylene Glycol, Glycerin, Paraffinum Liquidum, centella asiatica </span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\"><o:p></o:p></span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\">extract, hexapeptide-3, Dmdm hydantoin, Phenoxyethanol, </span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\"><o:p></o:p></span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\">Triethanolamine, Collagen, Disodium EDTA, BHT, Cananga </span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\"><o:p></o:p></span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\">odorata Flower Oil.</span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0.0000pt;\"><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\"></span></p>', '<p class=\"MsoNormal\" style=\"margin-bottom:0.0000pt;\"><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">Centella Asiatica</span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\"></span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">Centella asiatica kaya akan asam amino, beta karoten, asam lemak, dan berbagai fitokimia kuat.</span><span class=\"15\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\"></span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">Ekstrak telah ditemukan untuk menenangkan peradangan, mempercepat penyembuhan luka, merangsang pertumbuhan sel baru, membangun kolagen, dan meningkatkan sirkulasi.</span><span class=\"15\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0.0000pt;\"><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\"><o:p></o:p></span></p><p class=\"17\" style=\"margin-bottom:0.0000pt;margin-left:36.0000pt;text-indent:-18.0000pt;\r\nmso-list:l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Calibri; background: rgb(245, 245, 245);\">-</span><!--[endif]--><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">Glycolic Acid berfungsi mencerahkan kulit wajah, dan mengurangi flek hitam atau bekas jerawat.</span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\"><o:p></o:p></span></p><p class=\"17\" style=\"margin-bottom:0.0000pt;margin-left:36.0000pt;text-indent:-18.0000pt;\r\nmso-list:l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family: Calibri; background: rgb(245, 245, 245);\">-</span><!--[endif]--><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">Marine Collagen merupakan kandungan yang bertindak sebagai anti-aging, melawan kerutan dan tanda penuaan pada kulit wajah.</span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\"><o:p></o:p></span></p>', '072021270609948_24.jpg', '2021-05-21 03:36:12', '2021-07-26 23:35:09'),
(3, 'Intense Brightening Serum', '<p class=\"15\" style=\"margin-bottom:0.0000pt;margin-left:36.0000pt;text-indent:-18.0000pt;\r\nmso-list:l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family:Calibri;font-size:11.0000pt;\">-</span><!--[endif]--><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\">Tekan pump pada botol, keluarkan isi produk sebanyak 2-3 tekanan. Usap dan ratakan ke seluruh wajah</span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\"><o:p></o:p></span></p><p class=\"15\" style=\"margin-bottom:0.0000pt;margin-left:36.0000pt;text-indent:-18.0000pt;\r\nmso-list:l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family:Calibri;font-size:11.0000pt;\">-</span><!--[endif]--><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\">Pijat lembut pada bagian wajah dan leher dengan ujung jari anda</span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\"><o:p></o:p></span></p><p class=\"15\" style=\"margin-bottom:0.0000pt;margin-left:36.0000pt;text-indent:-18.0000pt;\r\nmso-list:l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family:Calibri;font-size:11.0000pt;\">-</span><!--[endif]--><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\">Gunakan secara teratur pada malam hari setelah membersihkan wajah.</span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\"><o:p></o:p></span></p>', 'NA18211900774', '20', '380', '250000', 'Youthderma Intense Brightening Serum memilki formulasi 3in1 (Brightening, Anti aging & Anti Wrinkle). Serum ini diformulasikan khusus untuk mencerahkan, mengencangkan dan mengurangi pigmentasi kulit atau flek hitam serta berfungsi melawan tanda  tanda penuaan pada kulit wajah.', 'Gently apply over cleansed skin & neck followed by other Youthderma Skin Care Products to give your skin luminous finish.', 'Semua Jenis Kulit Kulit', '-', '<p class=\"MsoNormal\" style=\"margin-bottom:0.0000pt;\"><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\">Aqua, Ethy l as corbi c ac id, Astaxanthin, Glycerin, Argania Spinosa Kernel Oil, TEA ( Camelia Sinensis ) Oil, Dmdm hydantoin, Phenoxyethanol, Ethylene/acrylic a c i d c o p o l y m e r, S o d i u m Metabisulfite, Disodium EDTA</span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\"><o:p></o:p></span></p>', '<p class=\"MsoNormal\" style=\"margin-bottom:0.0000pt;\"><span class=\"15\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">- </span><span class=\"15\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">Ethyl </span><span class=\"15\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">Ascorbic Acid Bahan aktif untuk mencerahkan warna kulit dan memperbaiki tampilan perubahan warna seperti bintik matahari, dan hiper pigmentasi.</span><span class=\"15\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0.0000pt;\"><span class=\"15\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">- </span><span class=\"15\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">Argan Oil </span><span class=\"15\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">Kaya vitamin A dan C, serta sifat anti oksidan yang sangat baik untuk kesehatan kulit.</span><span class=\"15\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\"><o:p></o:p></span></p>', '072021270653465_26.jpg', '2021-05-21 06:02:06', '2021-07-26 23:33:53'),
(4, 'Acne Care Serum', '<p class=\"15\" style=\"margin-bottom:0.0000pt;margin-left:36.0000pt;text-indent:-18.0000pt;\r\nmso-list:l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family:Calibri;font-size:11.0000pt;\">-</span><!--[endif]--><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\">Tekan pump pada botol, keluarkan isi produk sebanyak 2-3 tekanan. Usap dan ratakan ke seluruh wajah</span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\"><o:p></o:p></span></p><p class=\"15\" style=\"margin-bottom:0.0000pt;margin-left:36.0000pt;text-indent:-18.0000pt;\r\nmso-list:l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family:Calibri;font-size:11.0000pt;\">-</span><!--[endif]--><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\">Pijat lembut pada bagian wajah yang berjerawat dengan ujung jari anda</span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\"><o:p></o:p></span></p><p class=\"15\" style=\"margin-bottom:0.0000pt;margin-left:36.0000pt;text-indent:-18.0000pt;\r\nmso-list:l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family:Calibri;font-size:11.0000pt;\">-</span><!--[endif]--><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\">Gunakan secara teratur pada malam hari setelah membersihkan wajah.</span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\"><o:p></o:p></span></p>', 'NA18210102720', '20', '100', '250000', 'Youthderma Acne Care Serum memilki kandungan utama Salicylic Acid, Tea Tree Oil, Calendula dan Centella Asiatica mengandalkan bahan-bahan berkualitas tinggi untuk mengurangi jerawat, pori-pori yang tersumbat, dan meratakan warna kulit.', '-', 'Kulit Berjerawat dan Berminyak', '-', '<p class=\"MsoNormal\" style=\"margin-bottom:0.0000pt;\"><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\">Aqua, Glycerin, portulaca oleracea, extract, Chlorophyll, calendula officinalis, flower extract, centella asiatica extract, , TEA Tree ( Melaleuca Alternifolia ) Oil, Salicylic Acid, Cinnamomum Camphora, Extract, aloe barbadensis leaf extract, Matricaria (Chamomilla Recutita) Extract, Dmdm hydantoin, Phenoxyethanol, </span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\"><o:p></o:p></span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\">Sodium Metabisulfite, Ethylene/Acrylic , Acid Copolymer, Disodium EDTA.</span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0.0000pt;\"><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\"></span></p>', '<p class=\"MsoNormal\" style=\"margin-bottom:0.0000pt;\"><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">- </span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">Salicylic Acid</span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\"></span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">merupakan </span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">asam beta hidroksi.</span><span class=\"15\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\"></span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">Ini terkenal untuk mengurangi jerawat dengan pengelupasan kulit dan menjaga pori-pori tetap bersih.</span><span class=\"15\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0.0000pt;\"><span class=\"15\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0.0000pt;\"><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">- Centella asiatica kaya akan asam amino, beta karoten, asam lemak, dan berbagai fitokimia kuat.</span><span class=\"15\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\"></span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">Ekstrak telah ditemukan untuk menenangkan peradangan, mempercepat penyembuhan luka, merangsang pertumbuhan sel baru, membangun kolagen, dan meningkatkan sirkulasi.</span><span class=\"15\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0.0000pt;\"><span class=\"15\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0.0000pt;\"><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">- Calendula membantu mengatasi jerawat karena memilki fungsi sebagai antiseptik</span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">, mempercepat proses penyembuhan dan mengatasi berbagai masalah kulit.</span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\"><o:p></o:p></span></p>', '072021270623324_22.jpg', '2021-05-21 06:02:06', '2021-07-26 23:36:23'),
(5, 'Gentle Cleansing Gel', '<p class=\"15\" style=\"margin-bottom:0.0000pt;margin-left:36.0000pt;text-indent:-18.0000pt;\r\nmso-list:l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family:Calibri;font-size:11.0000pt;\">-</span><!--[endif]--><span style=\"mso-spacerun:\'yes\';font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';\r\nfont-size:11.0000pt;\">Basahi wajah dengan air</span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';\r\nfont-size:11.0000pt;\"><o:p></o:p></span></p><p class=\"15\" style=\"margin-bottom:0.0000pt;margin-left:36.0000pt;text-indent:-18.0000pt;\r\nmso-list:l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family:Calibri;font-size:11.0000pt;\">-</span><!--[endif]--><span style=\"mso-spacerun:\'yes\';font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';\r\nfont-size:11.0000pt;\">Tekan punp pada botol, keluarkan isi produk sebanyak 3-4 tekanan. Pijat diatas wajah & leher yang telah dibasahi sebelumnya</span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';\r\nfont-size:11.0000pt;\"><o:p></o:p></span></p><p class=\"15\" style=\"margin-bottom:0.0000pt;margin-left:36.0000pt;text-indent:-18.0000pt;\r\nmso-list:l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family:Calibri;font-size:11.0000pt;\">-</span><!--[endif]--><span style=\"mso-spacerun:\'yes\';font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';\r\nfont-size:11.0000pt;\">Bilas hingga bersih</span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';\r\nfont-size:11.0000pt;\"><o:p></o:p></span></p><p class=\"15\" style=\"margin-bottom:0.0000pt;margin-left:36.0000pt;text-indent:-18.0000pt;\r\nmso-list:l0 level1 lfo1;\"><!--[if !supportLists]--><span style=\"font-family:Calibri;font-size:11.0000pt;\">-</span><!--[endif]--><span style=\"mso-spacerun:\'yes\';font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';\r\nfont-size:11.0000pt;\">Lakukan 2 kali sehari. Cukup lakukan 2 kali sehari saja. Hal ini bertujuan agar kulit tetap terjaga kelembapannya.</span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';\r\nfont-size:11.0000pt;\"><o:p></o:p></span></p>', 'NA18211202244', '120', '210', '130000', 'Youthderma Gentle Cleansing Gel merupakan pembersih wajah yang memilki PH seimbang, ringan dan lembut untuk pembersihan menyeluruh. Memilki fungsi menjaga skin barrier agar tetap terlindungi, dan menjaga kelembaban kulit setelah membersihkan wajah. Youthderma Gentle Cleansing Gel sangat cocok untuk kulit sensitive dan semua jenis kulit.', '-', 'Semua Jenis Kulit, kulit sensitive dan kulit berjerawat.', 'Supple, softened and gently cleansed.', '<p class=\"MsoNormal\"><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\">Aqua, Potassium Cocoate, Carbomer, Cocamide DEA, Lactic Acid, centella </span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\"><o:p></o:p></span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\">asiatica extract, ceramide 3, Ascorbyl Glucoside, Phenoxyethanol, Dmdm </span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\"><o:p></o:p></span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;font-size:11.0000pt;\">hydantoin, Citric Acid, ci 42090</span></p>', '<p class=\"MsoNormal\" style=\"margin-bottom:0.0000pt;\"><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">- Centella asiatica (sering disebut centella) kaya akan asam amino, beta karoten, asam lemak, dan berbagai fitokimia kuat.</span><span class=\"15\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\"></span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">Ekstrak telah ditemukan untuk menenangkan peradangan, mempercepat penyembuhan luka, merangsang pertumbuhan sel baru, membangun kolagen, dan meningkatkan sirkulasi.</span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\"><o:p></o:p></span></p><p class=\"MsoNormal\"><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">- Ceramide berfungsi </span><span style=\"mso-spacerun:\'yes\';font-family:Calibri;mso-bidi-font-family:\'Times New Roman\';\r\nfont-size:11.0000pt;\"></span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">melembabkan kulit, menjaga pelindung alami kulit, yang menjaga kulit tetap terhidrasi dan memberikan perlindungan terhadap iritasi dan allergen.</span></p>', '072021270647950_23.jpg', '2021-05-21 06:03:14', '2021-07-26 23:35:47'),
(12, 'Youthderma Beautydeals Package (B)', '<p class=\"15\" style=\"margin-right: 0px; margin-bottom: 0pt; margin-left: 36pt; color: rgb(85, 85, 85); font-family: Arial; font-size: 15px; text-indent: -18pt;\"><span style=\"font-family: Calibri; font-size: 11pt;\">-</span><span style=\"font-family: Calibri; font-size: 11pt;\">Tekan pump pada botol, keluarkan isi produk sebanyak 2-3 tekanan. Usap dan ratakan ke seluruh wajah</span><span style=\"font-family: Calibri; font-size: 11pt;\"><o:p></o:p></span></p><p class=\"15\" style=\"margin-right: 0px; margin-bottom: 0pt; margin-left: 36pt; color: rgb(85, 85, 85); font-family: Arial; font-size: 15px; text-indent: -18pt;\"><span style=\"font-family: Calibri; font-size: 11pt;\">-</span><span style=\"font-family: Calibri; font-size: 11pt;\">Pijat lembut pada bagian wajah dan leher dengan ujung jari anda</span><span style=\"font-family: Calibri; font-size: 11pt;\"><o:p></o:p></span></p><p class=\"15\" style=\"margin-right: 0px; margin-bottom: 0pt; margin-left: 36pt; color: rgb(85, 85, 85); font-family: Arial; font-size: 15px; text-indent: -18pt;\"><span style=\"font-family: Calibri; font-size: 11pt;\">-</span><span style=\"font-family: Calibri; font-size: 11pt;\">Gunakan secara teratur pada siang hari setelah membersihkan wajah dan setelah menggunakan serum</span></p>', '-', '12', '440', '405000', 'Dalam paket ini terdapat:\r\n1 pcs Youthderma Daily Protection Sunscreen\r\n1 pcs Youthderma Intense Brightening Serum', '-', 'Semua jenis kulit.', '-', '<p><span style=\"font-family: Calibri; font-size: 14.6667px;\">Aqua, Titanium Dioxide, cetyl alcohol, Triceteareth-4, phosphate, sodium cocoyl glycinate, Tranexamic acid, ceramide 3, butylene glycol, ammonium acryloyldimethyltaurate/vp, copolymer, Phenyl Trimethicone, caprylyl methicone, Zinc Oxide, Glycerin, Argania Spinosa Kernel Oil, Phenoxyethanol, Dmdm hydantoin, Citric Acid, Glutathione, Disodium EDTA, cananga odorata flower oil, TEA ( Camelia Sinensis ) Oil.</span><br></p>', '<p class=\"MsoNormal\" style=\"margin-bottom: 0pt;\"><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">- Tranexamic Acid Bahan aktif untuk mencerahkan warna kulit dan memperbaiki tampilan perubahan warna seperti bintik matahari, dan hiper pigmentasi.</span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0pt;\"><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">- Zinc Oxide Memberikan perlindungan matahari berspektrum luas.</span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\"></span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">Mengurangi iritasi dan alergi kulit.</span><span class=\"15\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\"></span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">Juga menjaga kelembapan terkunci pada kulit kering.</span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0pt;\"><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">- Titanium Dioxide</span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">memilki manfaat perlindungan</span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">terhadap radiasi ultraviolet.</span></p>', '072021160838346_1.jpg', '2021-07-16 00:32:04', '2021-07-16 01:32:38'),
(13, 'Youthderma Beautydeals (Sunscreen & Acne Serum)', '<p class=\"15\" style=\"margin-bottom: 0pt; margin-left: 36pt; text-indent: -18pt;\"><span style=\"font-family: Calibri; font-size: 11pt;\">-&nbsp;</span><span style=\"font-family: Calibri; font-size: 11pt;\">Tekan pump pada botol, keluarkan isi produk sebanyak 2-3 tekanan. Usap dan ratakan ke seluruh wajah</span><span style=\"font-family: Calibri; font-size: 11pt;\"><o:p></o:p></span></p><p class=\"15\" style=\"margin-bottom: 0pt; margin-left: 36pt; text-indent: -18pt;\"><span style=\"font-family: Calibri; font-size: 11pt;\">-&nbsp;</span><span style=\"font-family: Calibri; font-size: 11pt;\">Pijat lembut pada bagian wajah yang berjerawat dengan ujung jari anda</span><span style=\"font-family: Calibri; font-size: 11pt;\"><o:p></o:p></span></p><p class=\"15\" style=\"margin-bottom: 0pt; margin-left: 36pt; text-indent: -18pt;\"><span style=\"font-family: Calibri; font-size: 11pt;\">-&nbsp;</span><span style=\"font-family: Calibri; font-size: 11pt;\">Gunakan secara teratur pada malam hari setelah membersihkan wajah.</span></p>', 'NA18210102720', '120', '110', '450000', 'Dalam paket ini terdapat:\r\n1 pcs Youthderma Acne Care Serum\r\n1 pcs Youthderma Daily Protection Sunscreen', '-', 'Kulit Berjerawat dan Berminyak', '-', '<p class=\"MsoNormal\" style=\"margin-bottom: 0pt;\"><span style=\"font-family: Calibri; font-size: 11pt;\">Aqua, Glycerin, portulaca oleracea, extract, Chlorophyll, calendula officinalis, flower extract, centella asiatica extract, , TEA Tree ( Melaleuca Alternifolia ) Oil, Salicylic Acid, Cinnamomum Camphora, Extract, aloe barbadensis leaf extract, Matricaria (Chamomilla Recutita) Extract, Dmdm hydantoin, Phenoxyethanol,&nbsp;</span><span style=\"font-family: Calibri; font-size: 11pt;\"><o:p></o:p></span><span style=\"font-family: Calibri; font-size: 11pt;\">Sodium Metabisulfite, Ethylene/Acrylic , Acid Copolymer, Disodium EDTA.</span><span style=\"font-family: Calibri; font-size: 11pt;\"><o: