(14, 'Youthderma Beautydeals (Cleansing, Sunscreen & Limited Tote Bag)', '<p class=\"15\" style=\"margin-bottom: 0pt; margin-left: 36pt; text-indent: -18pt;\"><span style=\"font-family: Calibri; font-size: 11pt;\">-&nbsp;</span><span style=\"font-family: Calibri; font-size: 11pt;\">Basahi wajah dengan air</span><span style=\"font-family: Calibri; font-size: 11pt;\"><o:p></o:p></span></p><p class=\"15\" style=\"margin-bottom: 0pt; margin-left: 36pt; text-indent: -18pt;\"><span style=\"font-family: Calibri; font-size: 11pt;\">-&nbsp;</span><span style=\"font-family: Calibri; font-size: 11pt;\">Tekan punp pada botol, keluarkan isi produk sebanyak 3-4 tekanan. Pijat diatas wajah &amp; leher yang telah dibasahi sebelumnya</span><span style=\"font-family: Calibri; font-size: 11pt;\"><o:p></o:p></span></p><p class=\"15\" style=\"margin-bottom: 0pt; margin-left: 36pt; text-indent: -18pt;\"><span style=\"font-family: Calibri; font-size: 11pt;\">-&nbsp;</span><span style=\"font-family: Calibri; font-size: 11pt;\">Bilas hingga bersih</span><span style=\"font-family: Calibri; font-size: 11pt;\"><o:p></o:p></span></p><p class=\"15\" style=\"margin-bottom: 0pt; margin-left: 36pt; text-indent: -18pt;\"><span style=\"font-family: Calibri; font-size: 11pt;\">-&nbsp;</span><span style=\"font-family: Calibri; font-size: 11pt;\">Lakukan 2 kali sehari. Cukup lakukan 2 kali sehari saja. Hal ini bertujuan agar kulit tetap terjaga kelembapannya.</span></p>', 'NA18211202244', '120', '210', '297000', 'Dalam paket ini terdapat:\r\n1 pcs Youthderma Gentle Cleansing Gel\r\n1 pcs Youthderma Daily Protection Sunscreen\r\n1 pcs Tote bag', '-', 'Semua Jenis Kulit, kulit sensitive dan kulit berjerawat.', '-', '<p><span style=\"font-family: Calibri; font-size: 11pt;\">Aqua, Potassium Cocoate, Carbomer, Cocamide DEA, Lactic Acid, centella&nbsp;</span><span style=\"font-family: Calibri; font-size: 11pt;\"><o:p></o:p></span><span style=\"font-family: Calibri; font-size: 11pt;\">asiatica extract, ceramid