(30, 'Youthderma Beautydeals Package (D)', '<p class=\"15\" style=\"margin-bottom: 0pt; margin-left: 36pt; text-indent: -18pt;\"><span style=\"font-family: Calibri; font-size: 11pt;\">-&nbsp;</span><span style=\"font-family: Calibri; font-size: 11pt;\">Tekan pump pada botol, keluarkan isi produk sebanyak 2-3 tekanan. Usap dan ratakan ke seluruh wajah</span><span style=\"font-family: Calibri; font-size: 11pt;\"><o:p></o:p></span></p><p class=\"15\" style=\"margin-bottom: 0pt; margin-left: 36pt; text-indent: -18pt;\"><span style=\"font-family: Calibri; font-size: 11pt;\">-&nbsp;</span><span style=\"font-family: Calibri; font-size: 11pt;\">Pijat lembut pada bagian wajah yang berjerawat dengan ujung jari anda</span><span style=\"font-family: Calibri; font-size: 11pt;\"><o:p></o:p></span></p><p class=\"15\" style=\"margin-bottom: 0pt; margin-left: 36pt; text-indent: -18pt;\"><span style=\"font-family: Calibri; font-size: 11pt;\">-&nbsp;</span><span style=\"font-family: Calibri; font-size: 11pt;\">Gunakan secara teratur pada malam hari setelah membersihkan wajah.</span></p>', 'NA18210102720', '20', '100', '225000', '1 pcs Youthderma Acne Care Serum\r\n1 pcs Tote bag', '-', 'Kulit Berjerawat dan Berminyak', '-', '<p class=\"MsoNormal\" style=\"margin-bottom: 0pt;\"><span style=\"font-family: Calibri; font-size: 11pt;\">Aqua, Glycerin, portulaca oleracea, extract, Chlorophyll, calendula officinalis, flower extract, centella asiatica extract, , TEA Tree ( Melaleuca Alternifolia ) Oil, Salicylic Acid, Cinnamomum Camphora, Extract, aloe barbadensis leaf extract, Matricaria (Chamomilla Recutita) Extract, Dmdm hydantoin, Phenoxyethanol,&nbsp;</span><span style=\"font-family: Calibri; font-size: 11pt;\"><o:p></o:p></span><span style=\"font-family: Calibri; font-size: 11pt;\">Sodium Metabisulfite, Ethylene/Acrylic , Acid Copolymer, Disodium EDTA.</span><span style=\"font-family: Calibri; font-size: 11pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0pt;\"><span style=\"font-family: Calibri; font-size: 11pt;\">&nbsp;</span></p>', '<p class=\"MsoNormal\" style=\"margin-bottom: 0pt;\"><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">-&nbsp;</span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">Salicylic Acid</span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">&nbsp;</span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">merupakan&nbsp;</span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">asam beta hidroksi.</span><span class=\"15\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">&nbsp;</span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">Ini terkenal untuk mengurangi jerawat dengan pengelupasan kulit dan menjaga pori-pori tetap bersih.</span><span class=\"15\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0pt;\"><span class=\"15\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0pt;\"><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">- Centella asiatica kaya akan asam amino, beta karoten, asam lemak, dan berbagai fitokimia kuat.</span><span class=\"15\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">&nbsp;</span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">Ekstrak telah ditemukan untuk menenangkan peradangan, mempercepat penyembuhan luka, merangsang pertumbuhan sel baru, membangun kolagen, dan meningkatkan sirkulasi.</span><span class=\"15\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0pt;\"><span class=\"15\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0pt;\"><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">- Calendula membantu mengatasi jerawat karena memilki fungsi sebagai antiseptik</span><span class=\"16\" style=\"font-family: Calibri; background: rgb(245, 245, 245);\">, mempercepat proses penyembuhan dan mengatasi berbagai masalah kulit.</span></p>', '072021161035925_15.jpg', '2021-07-16 03:40:35', '2021-07-16 03:40:35'),
